First we will create a new QObject subclass. As we want to implement it in Rust, we need to place our interface inside extern "RustQt". To create a new QObject subclass that will be defined in Rust, use a type-alias and mark it with #[qobject]. In our case the new class will be named MyObject and will be backed by a Rust struct named MyObjectRust. // The QObject definition // We tell CXX-Qt that we want a QObject class with the name MyObject // based on the Rust struct MyObjectRust. #[qobject] #[qml_element] #[qproperty(i32, number)] #[qproperty(QString, string)] #[namespace = "my_object"] type MyObject = super::MyObjectRust; The Rust struct must be defined outside the bridge module and is therefore referred to using super::. This just needs to be a normal Rust struct and can contain any kind of field, even Rust-only types that are not compatible with CXX. Unless we want to use CXX-Qt's Constructor feature we just need to ensure that this struct implements Rusts Default trait In this case we can just use #[derive(Default)] on the struct. #[derive(Default)]
pub struct MyObjectRust { number: i32, string: QString,
} Now the #[qobject] macro will take care of creating a new QObject subclass named MyObject. Every instance of MyObject will include an instance of the MyObjectRust struct that can be used to work with data defined in Rust. To automatically export this new class to QML, we mark it with the #[qml_element] attribute. This is the same as specifying QML_ELEMENT in C++. We later define a QML module for our type when building with Cargo or CMake . The #[qproperty] attribute will create a Q_PROPERTY for the given type and field name. CXX-Qt will then: Create the Q_PROPERTY on the QObject type. Create a NOTIFY signal for when the property changes. Generate getters and setters that use the underlying Rust fields and emit the NOTIFY signal on changes. In this case the newly created QObject subclass will have two properties: number and string. CXX-Qt expects a field for each property to exist in the underlying Rust struct. For names that contain multiple words, like my_number, CXX-Qt allows you to rename the property in C++ with a custom cxx_name or rust_name. See the property documentation for more information.

