In src/main.rs, first import the cxxqt_object module and some types we will need to run our Qt application: pub mod cxxqt_object; use cxx_qt::casting::Upcast;
use cxx_qt_lib::{QGuiApplication, QQmlApplicationEngine, QQmlEngine, QUrl};
use std::pin::Pin; Define the main function that will be called when the executable starts. This works just like starting a QML application in C++: Create a QGuiApplication Create a QQmlApplicationEngine Set the QML file path to the engine Run the application fn main() { // Create the application and engine let mut app = QGuiApplication::new(); let mut engine = QQmlApplicationEngine::new(); // Load the QML path into the engine if let Some(engine) = engine.as_mut() { engine.load(&QUrl::from("qrc:/qt/qml/com/kdab/cxx_qt/demo/qml/main.qml")); } if let Some(engine) = engine.as_mut() { let engine: Pin<&mut QQmlEngine> = engine.upcast_pin(); // Listen to a signal from the QML Engine engine .on_quit(|_| { println!("QML Quit!"); }) .release(); } // Start the app if let Some(app) = app.as_mut() { app.exec(); }
} To build and run the application, use cargo run. üìù Note : In order for CXX-Qt to work, the qmake executable must be located. This is because CXX-Qt relies on qmake to locate the necessary Qt libraries and header files on your system. cxx-qt will find qmake in the following order: Look for an environment variable QMAKE that should have the path to qmake. e.g.: QMAKE=/usr/bin/qmake cargo run Use qmake from the PATH. If multiple qmake exists in PATH, environment variable QT_VERSION_MAJOR will control the selected one. To check which version of Qt will be used with qmake, you can use the qmake -query command. This will display information about the Qt installation, including the version number and installation path. Check CxxQtBuilder for more information If this fails for any reason, take a look at the examples/cargo-without-cmake folder in the CXX-Qt repository, which contains the complete example code. If you have cloned the CXX-Qt repository, you can run this example from within the repository using: cargo run -p qml-minimal-no-cmake You should now see the two Labels that display the state of our MyObject, as well as the two buttons to call our two Rust functions.

