CXX-Qt allows invokables to be generated with the C++ modifiers necessary to implement inheritance. This way methods can be overridden, declared as virtual or final. C++ keyword CXX-Qt attribute override #[cxx_override] virtual #[cxx_virtual] final #[cxx_final] The example below overrides the data method inherited from the QAbstractListModel. extern "RustQt" { #[qobject] #[base = QAbstractListModel] type AbstractBaseClass = super::AbstractBaseClassRust; #[qobject] #[base = AbstractBaseClass] #[qml_element] #[qproperty(State, state)] type CustomBaseClass = super::CustomBaseClassRust; } extern "RustQt" { #[qinvokable] #[cxx_override] fn data(self: &CustomBaseClass, index: &QModelIndex, role: i32) -> QVariant; } impl qobject::CustomBaseClass { /// Retrieve the data for a given index and role pub fn data(&self, index: &QModelIndex, role: i32) -> QVariant { let role = qobject::Roles { repr: role }; if let Some((id, value)) = self.vector.get(index.row() as usize) { return match role { qobject::Roles::Id => QVariant::from(id), qobject::Roles::Value => QVariant::from(value), _ => QVariant::default(), }; } QVariant::default() }
} Full example When a method is overridden using cxx_override, the base class version of the method can be accessed by using #[inherit] in combination with the #[cxx_name] attribute. In this case the base class version of the function must get a different name because Rust can't have two functions with the same name on one type. Example: extern "RustQt" { #[qobject] #[base = QAbstractListModel] type AbstractBaseClass = super::AbstractBaseClassRust; #[qobject] #[base = AbstractBaseClass] #[qml_element] #[qproperty(State, state)] type CustomBaseClass = super::CustomBaseClassRust; } unsafe extern "RustQt" { /// Inherited canFetchMore from the base class #[cxx_name = "canFetchMore"] #[inherit] fn base_can_fetch_more(self: &CustomBaseClass, parent: &QModelIndex) -> bool; /// Inherited index from the base class #[inherit] fn index( self: &CustomBaseClass, row: i32, column: i32, parent: &QModelIndex, ) -> QModelIndex; } extern "RustQt" { /// Return whether the base class can fetch more // Example of overriding a C++ virtual method and calling the base class implementation. #[qinvokable] #[cxx_override] #[cxx_name = "canFetchMore"] fn can_fetch_more(self: &CustomBaseClass, parent: &QModelIndex) -> bool; } impl qobject::CustomBaseClass { /// Return whether the base class can fetch more // Example of overriding a C++ virtual method and calling the base class implementation. pub fn can_fetch_more(&self, parent: &QModelIndex) -> bool { self.base_can_fetch_more(parent) }
} Full example

