mod ffi { extern "RustQt" { }
} The extern "RustQt" section of a CXX-Qt bridge declares Rust types and signatures to be made available to Qt and C++. The CXX-Qt code generator uses your extern "RustQt" section(s) to produce a C++ header file containing the corresponding C++ declarations. The generated header has the same file name as the input rust file but with .cxxqt.h file extension. A bridge module may contain zero or more extern "RustQt" blocks. This complements the extern "Rust" CXX section but allows for declaring Qt specific features on C++ types. Automatically converting to camel or snake case can be done through an attribute at the block level.

