As with all things Rust, we'll want to create a cargo project. Run the following command inside a tutorial folder to initialize the Rust part of the project. $ cargo new qml_minimal
$ cd qml_minimal If you want to skip building with Cargo and try building with CMake directly you can add the --lib option here. That will make it easier to create a static library in Rust and use CMake to link this into a C++ executable. We'll discuss details of this later, when we integrate our Rust project with CMake Building with Cargo is easier to start with, so if in doubt, try building with Cargo first. As outlined in the previous section, to use CXX-Qt, we'll create a Rust module within this crate. This Rust module will then serve as our interface between Qt and Rust. First, in the src/main.rs, we tell Cargo about the module we're about to create: pub mod cxxqt_object; Now, we need to create a file rust/src/cxxqt_object.rs for that module. It will include our #[cxx_qt::bridge] that allows us to interact with Qt concepts. This is a lot to take in, so let's go one step at a time. /// The bridge definition for our QObject
#[cxx_qt::bridge]
pub mod qobject { unsafe extern "C++" { include!("cxx-qt-lib/qstring.h"); /// An alias to the QString type type QString = cxx_qt_lib::QString; } extern "RustQt" { // The QObject definition // We tell CXX-Qt that we want a QObject class with the name MyObject // based on the Rust struct MyObjectRust. #[qobject] #[qml_element] #[qproperty(i32, number)] #[qproperty(QString, string)] #[namespace = "my_object"] type MyObject = super::MyObjectRust; // Declare the invokable methods we want to expose on the QObject #[qinvokable] #[cxx_name = "incrementNumber"] fn increment_number(self: Pin<&mut Self>); #[qinvokable] #[cxx_name = "sayHi"] fn say_hi(&self, string: &QString, number: i32); }
} use core::pin::Pin;
use cxx_qt_lib::QString; /// The Rust struct for the QObject
#[derive(Default)]
pub struct MyObjectRust { number: i32, string: QString,
} impl qobject::MyObject { /// Increment the number Q_PROPERTY pub fn increment_number(self: Pin<&mut Self>) { let previous = *self.number(); self.set_number(previous + 1); } /// Print a log message with the given string and number pub fn say_hi(&self, string: &QString, number: i32) { println!("Hi from Rust! String is '{string}' and number is {number}"); }
}

