The #[qproperty(TYPE, NAME, ...)] attribute can be specified on a #[qobject] marked type to expose a Q_PROPERTY on the generated QObject. // The QObject definition // We tell CXX-Qt that we want a QObject class with the name MyObject // based on the Rust struct MyObjectRust. #[qobject] #[qml_element] #[qproperty(i32, number)] #[qproperty(QString, string)] #[namespace = "my_object"] type MyObject = super::MyObjectRust; If no other attributes are specified on the property, CXX-Qt will generate setters and getters, as well as a "changed" signal automatically. The type and name of the property must then match a field in the inner Rust struct. #[derive(Default)]
pub struct MyObjectRust { number: i32, string: QString,
} CXX-Qt will then generate these functions: C++ Rust setter set<Property> [1] set_<property> getter get<Property> [1] <property> changed signal <property>Changed <property>_changed As with any signal , CXX-Qt will generate the corresponding connection functions on the Rust side: connect: connect_<property>_changed on: on_<property>_changed Where <property> is the name of the property. These setters and getters assure that the changed signal is emitted every time the property is edited. For the C++ getters and setters, the first character of the property name will automatically be upper-cased. For single-word property names, this leads to camelCase naming, which is the default in Qt.

