CXX-Qt relies on CXX to expose enums from Rust to C++ and vice-versa. However, CXX only supports free enums that are not defined as part of a class. CXX-Qt doesn't change this, it only additionally exposes the enum as part of a QObject type to the meta-object system. So any #[qenum] in CXX-Qt is available as both a normal shared CXX enum and a Q_ENUM inside the associated QObject. To expose a shared enum as a Q_ENUM inside a QObject class, add the #[qenum(...)] attribute to the enum definition. The argument to #[qenum(...)] must be the name of a #[qobject] that is defined in a extern "RustQt" block. It is currently not possible to add a #[qenum(...)] to any extern "C++Qt" QObjects or a QObject that is defined in another #[cxx_qt::bridge]. Example: #[cxx_qt::bridge]
pub mod qobject { #[qenum(CustomBaseClass)] /// State of the CustomBaseClass list model enum State { /// Another item is being added in the background Running, /// No items are being added in the background Idle, } extern "RustQt" { #[qobject] #[base = QAbstractListModel] type AbstractBaseClass = super::AbstractBaseClassRust; #[qobject] #[base = AbstractBaseClass] #[qml_element] #[qproperty(State, state)] type CustomBaseClass = super::CustomBaseClassRust; }
}

