Whilst Q_ENUM_NS creates the appropriate meta-objects, it doesn't add them to QML automatically. Like with Q_ENUM, access to the enum variants also doesn't happen through the enum directly, but rather the surrounding namespace. Therefore, the namespace must be registered with the meta-object system and then exposed to QML. CXX-Qt automatically registers the namespace of a namespaced #[qenum] with the meta-object system. Registration with QML can then be done by placing a qnamespace!("...") macro inside the bridge that defines the namespaced #[qenum] and adding a #[qml_element] attribute. #[cxx_qt::bridge]
pub mod qobject { #[qml_element] qnamespace!("Colors"); #[qenum] #[namespace = "Colors"] /// An enum of colors enum Color { /// Red Red, /// Green Green, /// Blue Blue, }
} Usage from QML: ToolButton { text: qsTr("Red") onClicked: root.rustInvokables.storeColorWithEnum(Colors.Red); }
